import {Catalog} from 'react-planner';
import Holes1 from './holes/door/planner-element.jsx';
import Holes2 from './holes/sliding-door/planner-element.jsx';

let catalog = new Catalog();

catalog.registerElement( Holes1 );
catalog.registerCategory('doors', 'Doors', [Holes1, Holes2] );

export default catalog;
